import React from 'react';
import styled from "styled-components";
import Modal from "../../../modal/modal";
import Text from "../../../../theme/text";
import Input from "../../../../theme/input";

const Container = styled.div`
  background: #343434;
  border-radius: 10px;
  padding: 22px;
  width: 450px;
  z-index: 3;
  position: relative;
`;

let AddSkinModal = ({setShow}) => {

    const CancelPropagation = (event) =>{
        event.stopPropagation()
    }

    const DoNotReloadPage = (event) =>{
        event.preventDefault()
        setShow(false)
    }

    return (
        <Modal setShow={setShow}>
            <form onSubmit={(event) => DoNotReloadPage(event)} onClick={CancelPropagation}>
                <Container>
                    <div style={{textAlign: "center", marginBottom: "20px"}}>
                        <Text fontSize={"24px"}>
                            Add new skin
                        </Text>
                    </div>
                    <div style={{marginBottom: "12px"}}>
                        <Text fontSize={"20px"}>
                            Please, enter investment bagâ€™s name:
                        </Text>
                    </div>
                    <div>
                        <Input width={"calc(100% - 22px)"} placeholder={"Name"}/>
                    </div>
                </Container>
            </form>
        </Modal>
    )
}

export default AddSkinModal;
